import React, { useState, useEffect } from "react";
import { useNavigate } from "react-router-dom";
import '../../style/adminOrderPage.css';
import Pagination from "../common/Pagination";
import ApiService from "../../service/ApiService";

const OrderStatus = ["PENDING", "CONFIRMED", "SHIPPED", "DELIVERED", "CANCELLED", "RETURNED"];

const AdminOrdersPage = () => {
    const [orders, setOrders] = useState([]);
    const [filteredOrders, setFilteredOrders] = useState([]);
    const [statusFilter, setStatusFilter] = useState('');
    const [searchStatus, setSearchStatus] = useState('');
    const [currentPage, setCurrentPage] = useState(1);
    const [totalPages, setTotalPages] = useState(0);
    const [error, setError] = useState(null);
    const itemsPerPage = 10;
    const navigate = useNavigate();
    let errorTimeout;

    useEffect(() => {
        fetchOrders();
    }, [searchStatus, currentPage]);

    useEffect(() => {
        return () => {
            if (errorTimeout) clearTimeout(errorTimeout); // Clear timeout on component unmount
        };
    }, []);

    const fetchOrders = async () => {
        try {
            const response = searchStatus
                ? await ApiService.getAllOrderItemsByStatus(searchStatus)
                : await ApiService.getAllOrders();
            const orderList = response.orderItemList || [];
            setOrders(orderList);
            applyPagination(orderList);
        } catch (error) {
            handleError(error.response?.data?.message || error.message || 'Unable to fetch orders');
        }
    };

    const applyPagination = (data) => {
        const paginatedData = data.slice((currentPage - 1) * itemsPerPage, currentPage * itemsPerPage);
        setFilteredOrders(paginatedData);
        setTotalPages(Math.ceil(data.length / itemsPerPage));
    };

    const handleFilterChange = (e) => {
        const filterValue = e.target.value;
        setStatusFilter(filterValue);
        setCurrentPage(1);

        const filteredData = filterValue
            ? orders.filter(order => order.status === filterValue)
            : orders;
        applyPagination(filteredData);
    };

    const handleSearchStatusChange = (e) => {
        const value = e.target.value;
        setSearchStatus(value);
        setCurrentPage(1);
    };

    const handleError = (message) => {
        setError(message);
        if (errorTimeout) clearTimeout(errorTimeout);
        errorTimeout = setTimeout(() => setError(''), 3000);
    };

    const handleOrderDetails = (id) => {
        navigate(`/admin/order-details/${id}`);
    };

    return (
        <div className="admin-orders-page">
            <h2>Orders</h2>
            {error && <p className="error-message">{error}</p>}

            <div className="filter-container">
                <div className="statusFilter">
                    <label>Filter By Status</label>
                    <select value={statusFilter} onChange={handleFilterChange}>
                        <option value="">All</option>
                        {OrderStatus.map(status => (
                            <option key={status} value={status}>{status}</option>
                        ))}
                    </select>
                </div>
                <div className="searchStatus">
                    <label>Search By Status</label>
                    <select value={searchStatus} onChange={handleSearchStatusChange}>
                        <option value="">All</option>
                        {OrderStatus.map(status => (
                            <option key={status} value={status}>{status}</option>
                        ))}
                    </select>
                </div>
            </div>

            <table className="orders-table">
                <thead>
                    <tr>
                        <th>Order ID</th>
                        <th>Customer</th>
                        <th>Status</th>
                        <th>Price</th>
                        <th>Date Ordered</th>
                        <th>Actions</th>
                    </tr>
                </thead>
                <tbody>
                    {filteredOrders.map(order => (
                        <tr key={order.id}>
                            <td>{order.id}</td>
                            <td>{order.user.name}</td>
                            <td>{order.status}</td>
                            <td>Rs. {order.price.toFixed(2)}</td>
                            <td>{new Date(order.createdAt).toLocaleDateString()}</td>
                            <td>
                                <button onClick={() => handleOrderDetails(order.id)}>Details</button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>

            <Pagination
                currentPage={currentPage}
                totalPages={totalPages}
                onPageChange={(page) => setCurrentPage(page)}
            />
        </div>
    );
};

export default AdminOrdersPage;
